import React from "react";
import { Route, Switch } from "react-router-dom";
import App from "../App";
import HomePage from "../WebsitePages/HomePage";

const Routes = () => {
  return (
    <App>
      <Switch>
        <Route path="/" component={App} />
        <Route path="/goVegan" component={HomePage} />
      </Switch>
    </App>
  );
};

export default Routes;
